import React, { Component } from 'react'
import {Link} from 'react-router-dom';
import 'bootstrap';
import 'bootstrap/dist/css/bootstrap.css';
import 'bootstrap/dist/js/bootstrap.js';
import $ from 'jquery';
import Popper from 'popper.js';


import socket from '../components/SocketUser';


class NavigationBar extends Component {

  constructor(props){
    super(props);

  }

	toStaff = () =>{
		this.props.page = "Staff";

		this.setState({});
  }

	// toStudents = () =>{
	// 	props.state.page = "Students";

 //  }

	// toStudents = () =>{

	// 	props.state.page = "Students";

 //  }


  render() {
  	if(this.props.loggedIn == false){
    return (
		<div>
			<link
			  rel="stylesheet"
			  href="https://maxcdn.bootstrapcdn.com/bootstrap/4.3.1/css/bootstrap.min.css"
			  integrity="sha384-ggOyR0iXCbMQv3Xipma34MD+dH/1fQ784/j6cY/iJTQUOhcWr7x9JvoRxT2MZw1T"
			  crossorigin="anonymous"
			/>

		   <nav className="navbar navbar-expand-sm navbar-dark bg-dark">
		      <a className="navbar-brand" href="https://data.berkeley.edu">UC Berkeley Data Science</a>
		    </nav>

		</div>

  		)
  	}
  	else{
    return (
		<div>
			<link
			  rel="stylesheet"
			  href="https://maxcdn.bootstrapcdn.com/bootstrap/4.3.1/css/bootstrap.min.css"
			  integrity="sha384-ggOyR0iXCbMQv3Xipma34MD+dH/1fQ784/j6cY/iJTQUOhcWr7x9JvoRxT2MZw1T"
			  crossorigin="anonymous"
			/>

		   <nav className="navbar navbar-expand-sm navbar-dark bg-dark">

		      <a className="navbar-brand" href="https://data.berkeley.edu">UC Berkeley Data Science</a>
		      <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarsExample03" aria-controls="navbarsExample03" aria-expanded="false" aria-label="Toggle navigation">
		        <span className="navbar-toggler-icon"></span>
		      </button>

		      <div className="collapse navbar-collapse" id="navbarsExample03">
		        <ul className="navbar-nav mr-auto">


		          <li className="nav-item active">
		            <a className="nav-link" href="/">Home<span className="sr-only">(current)</span></a>
		          </li>
		          <li className="nav-item">
		            <a className="nav-link" onClick = {this.toStaff}>Staff</a>
		          </li>
		          <li className="nav-item">
		            <a className="nav-link" href="/students">Students</a>
		          </li>
  		          <li className="nav-item">
		            <a className="nav-link" href="/partners">Partners</a>
		          </li>
		          <li className="nav-item dropdown">
		            <a className="nav-link dropdown-toggle" href="http://example.com/" id="dropdown03" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">Dropdown</a>
		            <div className="dropdown-menu" aria-labelledby="dropdown03">
		              <a className="dropdown-item" href="https://getbootstrap.com/docs/4.0/examples/navbars/#">Action</a>
		              <a className="dropdown-item" href="https://getbootstrap.com/docs/4.0/examples/navbars/#">Another action</a>
		              <a className="dropdown-item" href="https://getbootstrap.com/docs/4.0/examples/navbars/#">Something else here</a>
		            </div>
		          </li>


		        </ul>

		      </div>
		    </nav>

		</div>
  		)
  	}
  }
}




